import React, { Component, PropTypes } from 'react';
import clsx from 'clsx';
import AppBar from '@material-ui/core/AppBar';
import Drawer from '@material-ui/core/Drawer';
import Toolbar from '@material-ui/core/ToolBar';
import { Button } from '@material-ui/core';
import {Link} from 'react-router-dom';
import List from '@material-ui/core/List';
import CssBaseline from '@material-ui/core/CssBaseline';
import Typography from '@material-ui/core/Typography';
import Divider from '@material-ui/core/Divider';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import ChevronLeftIcon from '@material-ui/icons/ChevronLeft';
import ChevronRightIcon from '@material-ui/icons/ChevronRight';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import InboxIcon from '@material-ui/icons/MoveToInbox';
import MailIcon from '@material-ui/icons/Mail';



class NavBar extends Component {
    constructor(props) {
        super(props);


    }


    state={
        open:false,
        setOpen:false
    };

    render() {

        const handleDrawerOpen = () => {
            setOpen=true;
        };

        const handleDrawerClose = () => {
            setOpen=false;
        };
        return (

            <div className="App">
            <CssBaseline />
            <AppBar
              position="fixed"
            >
              <Toolbar>
                <IconButton
                  color="inherit"
                  aria-label="open drawer"
                  onClick={handleDrawerOpen}
                  edge="start"
                >
                  <MenuIcon />
                </IconButton>
                <Typography variant="h6" noWrap>
                  Mini variant drawer
                </Typography>
              </Toolbar>
            </AppBar>
            <Drawer
              variant="permanent"

            >
              <div >
                <IconButton onClick={handleDrawerClose}>
                  <ChevronRightIcon /> 
                </IconButton>
              </div>
              <Divider />
              <List>

                  <ListItem button key="Home" component={Link} to="/">
                    <ListItemIcon><InboxIcon /> </ListItemIcon>
                    <ListItemText primary="Home" />
                  </ListItem>
                  <ListItem button key="Tests v/s Cases Summary" component={Link} to="/testvscases">
                    <ListItemIcon><InboxIcon /> </ListItemIcon>
                    <ListItemText primary="Tests v/s Cases Summary" />
                  </ListItem>
                  <ListItem button key="Distribution wrt Age groups" component={Link} to="/agegroup">
                    <ListItemIcon><InboxIcon /> </ListItemIcon>
                    <ListItemText primary="Distribution wrt Age groups" />
                  </ListItem>
                  <ListItem button key="Hospitalizations Summary" component={Link} to="/hospitalsbeds">
                    <ListItemIcon><InboxIcon /> </ListItemIcon>
                    <ListItemText primary="Hospitalizations Summary" />
                  </ListItem>

              </List>

            </Drawer>
            </div>

        );
    }
}



export default NavBar;
